Static variables are those variables which retain their values between different function calls. Static variables are initialized only once at compile time. They are used to maintain the state of a variable between function calls.
Static variables are of two types:
1. Internal Static Variables: These are the variables which are defined inside a function. They are initialized only once at compile time and retain their values between different function calls.
2. External Static Variables: These are the variables which are defined outside a function. They are initialized only once at compile time and retain their values between different function calls.
Register variables are those variables which are stored in a register instead of RAM. They are used to increase the speed of a program. Register variables are declared using the keyword "register".
The main difference between static and register variables is that static variables retain their values between different function calls, while register variables do not retain their values between different function calls.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10; // internal static variable
    register int y = 20; // register variable
    x++;
    y++;
    printf("x = %d, y = %d\n", x, y);
}

int main() {
    int i;
    for (i = 0; i < 5; i++) {
        func();
    }
    return 0;
}
```
In this example, the variable "x" is a static variable and retains its value between different function calls. The variable "y" is a register variable and does not retain its value between different function calls



