        // Pack id (4 bits)
        const id = entity.id;
        dataView.setUint8(byteIndex, (dataView.getUint8(byteIndex) & ~(0xF << bitIndex)) | ((id & 0xF) << bitIndex));
        bitIndex += 4;
        if (bitIndex >= 8) {
            bitIndex -= 8;
            byteIndex++;
        }

        // Pack size (3 bits)
        const size = entity.size;
        dataView.setUint8(byteIndex, (dataView.getUint8(byteIndex) & ~(0x7 << bitIndex)) | ((size & 0x7) << bitIndex));
        bitIndex += 3;
        if (bitIndex >= 8) {
            bitIndex -= 8;
            byteIndex++;
        }
    }

    return arrayBuffer;
}

function unpackEntities(arrayBuffer) {
