        const id = (dataView.getUint8(byteIndex) >> bitIndex) & 0xF;
        entities.push({ id, size: 0 }); // Initialize size to 0

        // Unpack size (3 bits)
        bitIndex += 4;
        if (bitIndex >= 8) {
            bitIndex -= 8;
            byteIndex++;
        }
        const size = (dataView.getUint8(byteIndex) >> bitIndex) & 0x7;
        entities[entities.length - 1].size = size; // Update size

        bitIndex += 3;
        if (bitIndex >= 8) {
            bitIndex -= 8;
            byteIndex++;
        }
    }

    return entities;
}
